import React from "react";
import { Redirect } from "react-router-dom";
import landingRoutes from "./views/landing/LandingRoutes";
import masterRoutes from "./views/configuration/masterRoutes";
import studentRoutes from "./views/applications/studentRoutes";
import userRoutes from "./views/administrations/userRoutes";


const redirectRoute = [
  {
    path: "/",
    exact: true,
    component: () => <Redirect to="/student/applicationStudent/list" />
  },
];

const errorRoute = [
  {
    component: () => <Redirect to="/session/404" />,
  },
];

const routes = [
  ...redirectRoute,
  ...landingRoutes,
  ...userRoutes,
  ...studentRoutes,
  ...masterRoutes,
  ...errorRoute,
];

export default routes;
